Defatted BSF larvae meal-fed quails also produced eggs with superior shell weight compared to those of the Control group (1.51 and 1.52 vs. 1.44 g for BSF10, BSF15 and Control groups, respectively; 
 p < 0.001), which caused a higher shell percentage compared to the Control group (10.4 and 10.5 vs. 10.1% for BSF10, BSF15 and Control groups, respectively). Also, yolk color increased with the increase in the inclusion level of defatted BSF larvae meal: Values were 4.99 vs. 5.57 vs. 5.81 for Control, BSF10 and BSF15 groups, respectively (
 p < 0.001).
